import React from 'react'
import Baner from "../../Components/Baner";
import logo from "../../Components/asset/darhanamin.PNG";


export default function HomePage() {
  return (
    <>
    <Baner />
      <>
    <img src={logo} width="400" alt='logo'></img>    
    </>
    </>
  )
}
